import React from 'react';
import './App.css';
import { Button, Container, Navbar } from 'react-bootstrap';

function App() {
  return (
    <div>
      <Container fluid>
        <Navbar expand="lg" variant="light" bg="light">
          <Navbar.Brand href="#">Navbar</Navbar.Brand>
        </Navbar>
      </Container>
      <Button variant="primary">Primary</Button>
      <p>hellp</p>
    </div>
  );
}

export default App;
